"use client"

import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useAuth } from '../context/AuthContext';
import { Link } from 'react-router-dom';
import { TrendingUp, Car, Users, Calendar, DollarSign, Wrench } from "lucide-react";
import { Area, AreaChart, CartesianGrid, XAxis, Bar, BarChart, ResponsiveContainer } from "recharts";
import { 
  BarChartIcon, 
  BoxIcon, 
  CalendarIcon
} from '@radix-ui/react-icons';
import PageHeader from './PageHeader';

const Dashboard = () => {
  const { user, isAdmin } = useAuth();
  const [stats, setStats] = useState({
    totalCars: 0,
    totalBookings: 0,
    pendingBookings: 0,
    approvedBookings: 0,
    canceledBookings: 0,
    activeUsers: 0,
    repairsInProgress: 0,
    overdueRentals: 0
  });
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    if (isAdmin) {
      fetchDashboardStats();
    } else {
      setLoading(false);
    }
  }, [isAdmin]);

  const fetchDashboardStats = async () => {
    try {
      const response = await axios.get('/api/reports/dashboard');
      setStats(response.data);
    } catch (error) {
      console.error('Error fetching dashboard stats:', error);
    } finally {
      setLoading(false);
    }
  };


  const adminHeaderStats = [
    {
      label: 'Total Cars',
      value: stats.totalCars,
      icon: BoxIcon
    },
    {
      label: 'Total Bookings',
      value: stats.totalBookings,
      icon: CalendarIcon
    },
    {
      label: 'Overdue Rentals',
      value: stats.overdueRentals,
      icon: CalendarIcon
    },
    {
      label: 'Active Users',
      value: stats.activeUsers,
      icon: BoxIcon
    }
  ];

  const quickActions = [
    <Link 
      key="cars"
      to="/cars" 
      className="bg-white/20 hover:bg-white/30 backdrop-blur-sm text-white px-6 py-3 rounded-lg text-sm font-medium inline-flex items-center transition-all duration-200 border border-white/20"
    >
      <BoxIcon className="w-5 h-5 mr-2" />
      Manage Cars
    </Link>,
    <Link 
      key="bookings"
      to="/bookings" 
      className="bg-white/20 hover:bg-white/30 backdrop-blur-sm text-white px-6 py-3 rounded-lg text-sm font-medium inline-flex items-center transition-all duration-200 border border-white/20"
    >
      <CalendarIcon className="w-5 h-5 mr-2" />
      View Bookings
    </Link>,
    <Link 
      key="reports"
      to="/reports" 
      className="bg-white/20 hover:bg-white/30 backdrop-blur-sm text-white px-6 py-3 rounded-lg text-sm font-medium inline-flex items-center transition-all duration-200 border border-white/20"
    >
      <BarChartIcon className="w-5 h-5 mr-2" />
      View Reports
    </Link>
  ];

  if (loading) {
    return (
      <div className="min-h-screen bg-gray-50 flex items-center justify-center">
        <div className="animate-spin rounded-full h-12 w-12 border-b-2 border-primary-600"></div>
